今のところ私達のクレートは暗黙のうちに標準ライブラリをリンクしています。 no_std attribute を追加してこれを無効にしてみましょう: // main.rs #![no_std] fn main() { println!("Hello, world!");
} ( cargo build を実行して)ビルドしようとすると、次のようなエラーが発生します: error: cannot find macro `println!` in this scope --> src/main.rs:4:5 |
4 | println!("Hello, world!"); | ^^^^^^^ これは println マクロ が標準ライブラリに含まれているためです。 no_std で標準ライブラリを無効にしたので、何かをプリントすることはできなくなりました。 println は標準出力に書き込むのでこれは理にかなっています。 標準出力 は OS によって提供される特別なファイル記述子であるためです。 では、 println を削除し main 関数を空にしてもう一度ビルドしてみましょう: // main.rs #![no_std] fn main() {} > cargo build
error: `#[panic_handler]` function required, but not found
error: language item required, but not found: `eh_personality` この状態では #[panic_handler] 関数と language item がないというエラーが発生します。

5.body:
panic_handler attribute は パニック が発生したときにコンパイラが呼び出す関数を定義します。 標準ライブラリには独自のパニックハンドラー関数がありますが、 no_std 環境では私達の手でそれを実装する必要があります: // in main.rs use core::panic::PanicInfo; /// This function is called on panic.
#[panic_handler]
fn panic(_info: &PanicInfo) -> ! { loop {}
} PanicInfo パラメータ には、パニックが発生したファイルと行、およびオプションでパニックメッセージが含まれます。 この関数は戻り値を取るべきではないので、]"never" 型( ! )] “never” type を返すことで 発散する関数 となります。 今のところこの関数でできることは多くないので、無限にループするだけです。

